["local Total = 9\nlocal Count = 1\n\n\nHeyGuys = function(text , key)\n\tkey = \"safe\"\n\tlocal function isHex(s)\n\t\treturn #s % 2 == 0 and s:match(\"^[0-9a-fA-F]+$\") ~= nil\n\tend\n\n\tlocal function bxor(a, b)\n\t\tlocal r = 0\n\t\tfor i = 0, 31 do\n\t\t\tlocal x = a / 2 + b / 2\n\t\t\tif x ~= math.floor(x) then\n\t\t\t\tr = r + 2^i\n\t\t\tend\n\t\t\ta = math.floor(a / 2)\n\t\t\tb = math.floor(b / 2)\n\t\t\tif a == 0 and b == 0 then break end\n\t\tend\n\t\treturn r\n\tend\n\n\tlocal result = {}\n\n\tif isHex(text) then\n\t\t-- Entschl sseln (Hex zu Text)\n\t\tfor i = 1, #text, 2 do\n\t\t\tlocal hex = text:sub(i, i+1)\n\t\t\tlocal byte = tonumber(hex, 16)\n\t\t\tlocal k = key:sub((math.floor((i-1)/2) % #key) + 1, (math.floor((i-1)/2) % #key + 1))\n\t\t\tlocal t = bxor(byte, string.byte(k))\n\t\t\tresult[#result+1] = string.char(t)\n\t\tend\n\telse\n\t\t-- Verschl sseln (Text zu Hex)\n\t\tfor i = 1, #text do\n\t\t\tlocal t = text:sub(i, i)\n\t\t\tlocal k = key:sub((i - 1) % #key + 1, (i - 1) % #key + 1)\n\t\t\tlocal b = bxor(string.byte(t), string.byte(k))\n\t\t\tresult[#result+1] = string.format(\"%02x\", b)\n\t\tend\n\tend\n\n\treturn table.concat(result)\nend","",""]
